public static Vector3 getAxisAngles(Quaternion a){
  float yaw=(float)Math.toDegrees(Math.atan2(2 * (a.getX() * a.getY() + a.getZ() * a.getW()),1 - 2 * (a.getY() * a.getY() + a.getZ() * a.getZ())));
